import React,{useEffect} from 'react'
import './rooms.css';
import { useDispatch,useSelector } from "react-redux";
import {fetchAllRoomsUser } from '../../redux/action-creators';
export default function Rooms() {
    const  {  errorRooms,roomsUserData } = useSelector((state) =>  state.fetchAllRoomsUserReducer);
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(fetchAllRoomsUser()) 
      }, []);


    return (
        <>

<ol className="list list-view-filter">
<h3 className='list-title'>Messages</h3>
  <li className='list-rooms'>List item 1</li>
  <li className='list-rooms'>List item 2</li>
  <li className='list-rooms'>List item 3</li>
  <li className='list-rooms'>List item 4</li>
  <li className='list-rooms'>List item 5</li>
  <li className='list-rooms'>List item 6</li>
</ol>
        </>
    )
}
